import React from 'react';

class Thumbnail extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return(
      <div className={ this.props.className }>
        <div className="thumbnail-img">
          <div className="thumbnail-overlay">
            <p> { this.props.name } </p>
          </div>
        </div>
      </div>
    )
  }
}

export default Thumbnail
